async function setVSignerType(k,o,i){
    vSigner = await new signer.Signer({
        // Specify URL of the node on Testnet
        NODE_URL: node
    });
    var prov = wavesexchangematchermatcher.replace("e/matcher", "e/signer/").replace("matcher-", "").replace("matcher.", "")
    switch(k){
        case "metamask":
            const provider = new providerMetamask.ProviderMetamask({
                wavesConfig: {
                    nodeUrl: waves.config.getNodeAddress(),
                    chainId: waves.config.getNetworkByte()
                }
            });
            vSigner.setProvider(provider);
            o ? document.location.reload(true) : ""
        break;
        case true:
            //provider web
            vSigner.setProvider(new providerWeb.ProviderWeb(prov))
            var user = await vSigner.login()
            saveLogin(JSON.stringify(user),user.address,i,true)
            o ? document.location.reload(true) : ""
        break;
        case false:
            //provider cloud
            vSigner.setProvider(new providerCloud.ProviderCloud())
            var user = await vSigner.login()
            saveLogin(JSON.stringify(user),user.address,i,true)
            o ? document.location.reload(true) : ""
        break;
    }
}


